import{_get as e}from"../_modules/get/get.min.js";async function getData(){e("/api/manage/myTeam/list",null).then(e=>{for(var t="",n=0;n<e.length;n++)"true"==e[n].accessOk?t+=`<tr class="padded"><td>${e[n].nickName}</td><td><div class="inlineInput"><button class="uiButton cancelButton" onclick="disown('${e[n].id}', this)">disown user</button></div></td></tr>`:t+=`<tr class="padded"><td>${e[n].nickName}</td><td><div class="inlineInput"><button class="uiButton returnButton" onclick="approveTeamUser('${e[n].id}', this)">re-approve user</button></div></td></tr>`;document.getElementById("tableHeader").insertAdjacentHTML("afterend",t)}).catch(e=>console.log(e))}async function approveTeamUser(t,n){n.innerText="...",e(`/api/manage/myTeam/scouts/access/${t}/true`,n.id).then(e=>{3206===e.status?n.innerText="approved user":n.innerText="error"}).catch(e=>console.log(e))}async function disown(t,n){n.innerText="...",e(`/api/manage/myTeam/scouts/access/${t}/false`,n.id).then(e=>{3206===e.status?n.innerText="disowned":n.innerText="error"}).catch(e=>console.log(e))}window.getData=getData,window.approveTeamUser=approveTeamUser,window.disown=disown;